pragma solidity ^0.4.17;


contract FE {
    uint public aa=55;


}


contract main {
    uint private num = 777;
    string public name;
    uint public number;
    address public owner;
    uint public superNumber;
    uint[] public ages;
    bytes32 public stroka;
    string public ns;
    address public newContract;
    uint public neoTime;

    struct User {
        string login;
        string password;
    }

    User[] public peoples;

    function main(uint _superNumber) public {
        owner = msg.sender;
        superNumber = _superNumber;
    }

    function updateNumber(uint _number) public {
        superNumber = _number;
    }

    function updateName(string _name) public {
        //require(msg.sender == owner);
        name = _name;
    }

    function setAges(uint[] _ages) public {
        for (uint i=0; i < _ages.length; i++) {
            ages.push(_ages[i]);
        }
    }

    function setBytes(bytes32 _str) public {
        stroka = _str;
    }

    function setS(string _s) public {
        ns = _s;
    }

    function setNewOwner(address _owner) public {
        owner = _owner;
    }

    function setStruct() public {
        peoples.push(User("ivan", "ivanov"));
    }

    function ls() public constant returns(uint) {
        return peoples.length;
    }

    function rb() public constant returns(bool) {
        return true;
    }

    function tr() public constant returns(bool) {
        require(msg.sender == owner);
        return true;
    }

    function deployAnotherContract() public returns(address) {
        newContract = new FE();
        return newContract;
    }

    function funTime() public {
        neoTime = now;
    }

     //
     //
     //
     //
     //
     // offline sign

}
